description:
In 2004, an explicit 42-minute sex tape emerged featuring Lewis and former husband Travis Wolfe in a Las Vegas hotel room.It was originally reported that Lewis and Wolfe made the sex video purely for their own private use and that it was accidentally leaked onto the Internet. In interviews, Lewis talked about the embarrassment she said she felt at the prospect of anybody being able to see her naked and performing sexual acts. However, this came into question as reports appeared suggesting that Lewis deliberately made and released the sex tape in order to increase her fame and make money from it.In some interviews, Lewis even mentioned how people could buy the video, arousing further suspicion.In December 2004, the New York Daily News reported that she, her husband and her manager were behind the website selling the video, and were receiving 70 percent of the sales profits.

